import React from 'react';


function NavBar() {
  return (
    <nav className="nav-bar">
      <div className="nav-item active">
        <img src={'./images/bottom_nav.jpeg'} alt="Home" className="icon"/>
        Home
      </div>
      <div className="nav-item">
        Scores
      </div>
      <div className="nav-item">
        Collection
      </div>
      <div className="nav-item">
        Club
      </div>
    </nav>
  );
}

export default NavBar;
